        let values = [ '00', 1, 2, 3, 4, 5, 6, 7, 8, 9 ];

        return (
            numsString.map((num) => {
                return (
                    <button className={`button ${[num]} nums`}>
                       {num}
                    </button> 
                )
            }) 
        )
    } 
}

export default Button;
